import { useState } from "react";

const Home = () => {

    const [name, setName] = useState('marco');

    const handleClick = () => {
        if (name === 'marco') {
            setName('polo');
        } else {
            setName('marco')
        }
    };

    return ( 
        <div className="home">
            <h2>Home Page</h2>
            <p>{ name }</p>
            <button onClick={handleClick}>Click Me</button>
        </div>
     );
}

export default Home;
